import React, { useState, useCallback } from 'react';
import { useQuery } from 'react-query';
import { searchAPI } from '../services/api';
import { Search, X, FileText, Highlighter } from 'lucide-react';

const SearchPanel = ({ isOpen, onClose, onResultClick, currentPdfUuid }) => {
  const [query, setQuery] = useState('');
  const [searchType, setSearchType] = useState('all');

  const { data: searchResults, isLoading, refetch } = useQuery(
    ['search', query, searchType, currentPdfUuid],
    () => searchAPI.search(query, currentPdfUuid, searchType),
    {
      enabled: query.length >= 2,
      select: (response) => response.data
    }
  );

  const handleSearch = useCallback((e) => {
    e.preventDefault();
    if (query.trim().length >= 2) {
      refetch();
    }
  }, [query, refetch]);

  const handleResultClick = (result) => {
    onResultClick(result);
    onClose();
  };

  if (!isOpen) return null;

  return (
    <div className="fixed right-0 top-0 h-full w-96 bg-white shadow-xl z-50 flex flex-col">
      {/* Header */}
      <div className="flex items-center justify-between p-4 border-b">
        <h2 className="text-lg font-semibold">Search</h2>
        <button
          onClick={onClose}
          className="p-2 hover:bg-gray-100 rounded"
        >
          <X className="h-5 w-5" />
        </button>
      </div>

      {/* Search Form */}
      <div className="p-4 border-b">
        <form onSubmit={handleSearch} className="space-y-3">
          <div className="relative">
            <Search className="absolute left-3 top-3 h-4 w-4 text-gray-400" />
            <input
              type="text"
              value={query}
              onChange={(e) => setQuery(e.target.value)}
              placeholder="Search PDFs and annotations..."
              className="w-full pl-10 pr-4 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
            />
          </div>
          
          <div className="flex space-x-2">
            <select
              value={searchType}
              onChange={(e) => setSearchType(e.target.value)}
              className="px-3 py-2 border rounded-lg text-sm"
            >
              <option value="all">All</option>
              <option value="content">Content</option>
              <option value="annotations">Annotations</option>
            </select>
            
            <button
              type="submit"
              disabled={query.length < 2}
              className="px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700 disabled:opacity-50 text-sm"
            >
              Search
            </button>
          </div>
        </form>
      </div>

      {/* Results */}
      <div className="flex-1 overflow-y-auto p-4">
        {isLoading && (
          <div className="flex items-center justify-center py-8">
            <div className="loading-spinner w-6 h-6"></div>
            <span className="ml-2">Searching...</span>
          </div>
        )}

        {searchResults && (
          <div className="space-y-4">
            <div className="text-sm text-gray-600">
              {searchResults.totalResults} results for "{searchResults.query}"
            </div>

            {Object.entries(searchResults.results).map(([pdfUuid, results]) => (
              <div key={pdfUuid} className="border rounded-lg p-3">
                <h3 className="font-medium text-sm text-gray-900 mb-2">
                  PDF: {pdfUuid.substring(0, 8)}...
                </h3>
                
                <div className="space-y-2">
                  {results.map((result, index) => (
                    <div
                      key={index}
                      onClick={() => handleResultClick(result)}
                      className="p-2 hover:bg-gray-50 rounded cursor-pointer border-l-2 border-gray-200 hover:border-blue-500"
                    >
                      <div className="flex items-start space-x-2">
                        {result.type === 'content' ? (
                          <FileText className="h-4 w-4 text-blue-500 mt-0.5" />
                        ) : (
                          <Highlighter className="h-4 w-4 text-yellow-500 mt-0.5" />
                        )}
                        
                        <div className="flex-1 min-w-0">
                          <div className="text-xs text-gray-500">
                            Page {result.pageNumber} • {result.type}
                          </div>
                          <div className="text-sm text-gray-900 truncate">
                            {result.content}
                          </div>
                          {result.notes && (
                            <div className="text-xs text-gray-600 mt-1">
                              Note: {result.notes}
                            </div>
                          )}
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              </div>
            ))}
          </div>
        )}

        {searchResults && searchResults.totalResults === 0 && (
          <div className="text-center py-8 text-gray-500">
            No results found for "{searchResults.query}"
          </div>
        )}
      </div>
    </div>
  );
};

export default SearchPanel;
